import React from 'react';

const Footer = () => {
  return (
    <footer className="bg-blue-600 text-white p-4 mt-8">
      <div className="container mx-auto text-center">
        <p>&copy; 2023 Insurance Company. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
